import React from 'react'
import { Carousel } from 'react-responsive-carousel';
import "./carousel.css";
import { Link } from "react-router-dom";
import { Nav } from "react-bootstrap";

import styled from "styled-components";

const CarouselStyled = () => {
    return (
        <React.Fragment>
            <Body>
                <Carousel>
                    <div>
                        <h5>MacBook Air</h5>
                        <img src="/images/premium.png" alt='' />
                        <p className="legend"></p>
                        <Buttons>
                            <div className="add-to-cart">
                                {/* < Nav.Link as={Link} to="https://premium-gadgets.vercel.app/">
                                    <button type="button">Order</button>
                                </Nav.Link> */}
                            </div>
                        </Buttons>
                    </div>
                    <div>
                        <h5>Magic Keyboard</h5>
                        <img src="/images/tania.png" alt='' />
                        <p className="legend"></p>
                    </div>
                    <div>
                        <h5>iPhones</h5>
                        <img src="/images/andey.png" alt='' />
                        <p className="legend"></p>
                    </div>
                    <div>
                        <h5>Macbook Pro 2021</h5>
                        <img src="/images/expenditure.png" alt='' />
                        <p className="legend"></p>
                    </div>
                    <div>
                        <h5>Ipad Pro</h5>
                        <img src="/images/crypto.png" alt='' />
                        <p className="legend"></p>
                    </div>
                    <div>
                        <h5>Apple Tv</h5>
                        <img src="/images/family.png" alt='' />
                        <p className="legend"></p>
                    </div>

                </Carousel>√è
            </Body>

        </React.Fragment>
    );
};

const Body = styled.div`
  max-width: 1152px;
  margin: auto;
  padding: 90px 50px 90px 50px;



  display: flex;
//   grid-template-columns: repeat(auto-fit, minmax(450px, 1fr));

  img {
    cursor: pointer;
    user-select: none;
    width: 50%;
  }

  @media (max-width: 1099px) {
    grid-column-gap: 40px;
  }

  @media (max-width: 1039px) {
    padding: 90px;
  }

  @media (max-width: 768px) {
    padding: 70px 0 0 0;
    grid-template-columns: 100%;
  }
`;



const Buttons = styled.div`
  display: flex;
  flex-wrap: wrap;
  color: #fff;


  .add-to-cart {
    button {
      height: 55px;
      width: 150px;
      background-color: #324d67;
      border: none;
      border-radius: 10px;
      color: #fff;
      align-items: center;
      display: flex;
      justify-content: center;

      img {
        margin-right: 10px;
      }

      color: white;
      font-weight: 700;
      cursor: pointer;
      transition: 100ms ease;
    }
  }

  @media (max-width: 499px) {
    .quantity {
      width: 100%;
      margin-bottom: 20px;
      margin-right: 0;
    }

    .add-to-cart {
      width: 100%;
      button {
        width: 100%;
      }
    }
  }
`;

export default CarouselStyled;
